INSERT INTO `notifications` (`id`, `title`, `subject`, `content`, `status`, `created`, `updated`) VALUES
(1, 'Customer activation', 'Account activation', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n                  <p>Dear {firstname},</p>\r\n                  <p> {store name} team welcomes you,\r\n                  <p>Thank you for registering an account with us, we have created an account for you, just one click <a href="{activation}"> here </a>  to confirm your email address.</p> </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-07-16'),
(2, 'Reset password', 'Reset password', '<table class="container content" align="center"><tbody><tr> <td>\r\n <table class="row note">\r\n    <tbody> <tr> <td class="wrapper last">\r\n          <p>Dear {Customer name},</p>\r\n          <p> You have requested for resetting your password for your account. <strong></strong> </p>\r\n         <p> This is Your New password {tmpPassword} </p><br>\r\n          <p> You this new password to login into your account <a href="{SITE_URL}"> ( Click here). </a> </p>  </td> </tr>\r\n    </tbody>\r\n  </table> \r\n</table>', 1, '0000-00-00', '2015-03-11'),
(3, 'Customer welcome mail', 'Customer account welcome', '\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8">\r\n<title>Customer account welcome</title>\r\n<!--IMPORTANT: \r\nBefore deploying this email template into your application make sure you convert all the css code in <style> tag using http://beaker.mailchimp.com/inline-css.\r\nChrome and other few mail clients do not support <style> tag so the above converter from mailchip will make sure that all the css code will be converted into inline css.\r\n-->\r\n<meta name="viewport" content="width=device-width">\r\n<style type="text/css">\r\n            /*********************************************************************\r\n            Ink - Responsive Email Template Framework Based: http://zurb.com/ink/\r\n            *********************************************************************/\r\n            #outlook a { \r\n            padding:0; \r\n            } \r\n            body{ \r\n            width:100% !important; \r\n            min-width: 100%;\r\n            -webkit-text-size-adjust:100%; \r\n            -ms-text-size-adjust:100%; \r\n            margin:0; \r\n            padding:0;\r\n            }         \r\n            img { \r\n            outline:none; \r\n            text-decoration:none; \r\n            -ms-interpolation-mode: bicubic;\r\n            width: auto; \r\n            height: auto;\r\n            max-width: 100%;\r\n            float: left; \r\n            clear: both; \r\n            display: block;\r\n            }\r\n            @media screen and (min-width:0\\0) {  \r\n                  /* IE9 and IE10 rule sets go here */  \r\n                  img.ie10-responsive { \r\n                        width: 100% !important;\r\n                  }\r\n            }  \r\n            center {\r\n            width: 100%;\r\n            min-width: 580px;\r\n            }\r\n            a img { \r\n            border: none;\r\n            }\r\n            p {\r\n            margin: 0 0 0 10px;\r\n            }\r\n            table {\r\n            border-spacing: 0;\r\n            border-collapse: collapse;\r\n            }\r\n            td { \r\n            word-break: break-word;\r\n            -webkit-hyphens: auto;\r\n            -moz-hyphens: auto;\r\n            hyphens: auto;\r\n            border-collapse: collapse !important; \r\n            }\r\n            table, tr, td {\r\n            padding: 0;\r\n            vertical-align: top;\r\n            text-align: left;\r\n            }\r\n            hr {\r\n            color: #d9d9d9; \r\n            background-color: #d9d9d9; \r\n            height: 1px; \r\n            border: none;\r\n            }\r\n            /* Responsive Grid */\r\n            table.body {\r\n            height: 100%;\r\n            width: 100%;\r\n            }\r\n            table.container {\r\n            width: 580px;\r\n            margin: 0 auto;\r\n            text-align: inherit;\r\n            }\r\n            table.row { \r\n            padding: 0px; \r\n            width: 100%;\r\n            position: relative;\r\n            }\r\n            table.container table.row {\r\n            display: block;\r\n            }\r\n            td.wrapper {\r\n            padding: 10px 20px 0px 0px;\r\n            position: relative;\r\n            }\r\n            table.columns,\r\n            table.column {\r\n            margin: 0 auto;\r\n            }\r\n            table.columns td,\r\n            table.column td {\r\n            padding: 0px 0px 10px; \r\n            }\r\n            table.columns td.sub-columns,\r\n            table.column td.sub-columns,\r\n            table.columns td.sub-column,\r\n            table.column td.sub-column {\r\n            padding-right: 10px;\r\n            }\r\n            td.sub-column, td.sub-columns {\r\n            min-width: 0px;\r\n            }\r\n            table.row td.last,\r\n            table.container td.last {\r\n            padding-right: 0px;\r\n            }\r\n            table.one { width: 30px; }\r\n            table.two { width: 80px; }\r\n            table.three { width: 130px; }\r\n            table.four { width: 180px; }\r\n            table.five { width: 230px; }\r\n            table.six { width: 280px; }\r\n            table.seven { width: 330px; }\r\n            table.eight { width: 380px; }\r\n            table.nine { width: 430px; }\r\n            table.ten { width: 480px; }\r\n            table.eleven { width: 530px; }\r\n            table.twelve { width: 580px; }\r\n            table.one center { min-width: 30px; }\r\n            table.two center { min-width: 80px; }\r\n            table.three center { min-width: 130px; }\r\n            table.four center { min-width: 180px; }\r\n            table.five center { min-width: 230px; }\r\n            table.six center { min-width: 280px; }\r\n            table.seven center { min-width: 330px; }\r\n            table.eight center { min-width: 380px; }\r\n            table.nine center { min-width: 430px; }\r\n            table.ten center { min-width: 480px; }\r\n            table.eleven center { min-width: 530px; }\r\n            table.twelve center { min-width: 580px; }\r\n            table.one .panel center { min-width: 10px; }\r\n            table.two .panel center { min-width: 60px; }\r\n            table.three .panel center { min-width: 110px; }\r\n            table.four .panel center { min-width: 160px; }\r\n            table.five .panel center { min-width: 210px; }\r\n            table.six .panel center { min-width: 260px; }\r\n            table.seven .panel center { min-width: 310px; }\r\n            table.eight .panel center { min-width: 360px; }\r\n            table.nine .panel center { min-width: 410px; }\r\n            table.ten .panel center { min-width: 460px; }\r\n            table.eleven .panel center { min-width: 510px; }\r\n            table.twelve .panel center { min-width: 560px; }\r\n            .body .columns td.one,\r\n            .body .column td.one { width: 8.333333%; }\r\n            .body .columns td.two,\r\n            .body .column td.two { width: 16.666666%; }\r\n            .body .columns td.three,\r\n            .body .column td.three { width: 25%; }\r\n            .body .columns td.four,\r\n            .body .column td.four { width: 33.333333%; }\r\n            .body .columns td.five,\r\n            .body .column td.five { width: 41.666666%; }\r\n            .body .columns td.six,\r\n            .body .column td.six { width: 50%; }\r\n            .body .columns td.seven,\r\n            .body .column td.seven { width: 58.333333%; }\r\n            .body .columns td.eight,\r\n            .body .column td.eight { width: 66.666666%; }\r\n            .body .columns td.nine,\r\n            .body .column td.nine { width: 75%; }\r\n            .body .columns td.ten,\r\n            .body .column td.ten { width: 83.333333%; }\r\n            .body .columns td.eleven,\r\n            .body .column td.eleven { width: 91.666666%; }\r\n            .body .columns td.twelve,\r\n            .body .column td.twelve { width: 100%; }\r\n            td.offset-by-one { padding-left: 50px; }\r\n            td.offset-by-two { padding-left: 100px; }\r\n            td.offset-by-three { padding-left: 150px; }\r\n            td.offset-by-four { padding-left: 200px; }\r\n            td.offset-by-five { padding-left: 250px; }\r\n            td.offset-by-six { padding-left: 300px; }\r\n            td.offset-by-seven { padding-left: 350px; }\r\n            td.offset-by-eight { padding-left: 400px; }\r\n            td.offset-by-nine { padding-left: 450px; }\r\n            td.offset-by-ten { padding-left: 500px; }\r\n            td.offset-by-eleven { padding-left: 550px; }\r\n            td.expander {\r\n            visibility: hidden;\r\n            width: 0px;\r\n            padding: 0 !important;\r\n            }\r\n            /* Alignment & Visibility Classes */\r\n            table.center, td.center {\r\n            text-align: center;\r\n            }\r\n            h1.center,\r\n            h2.center,\r\n            h3.center,\r\n            h4.center,\r\n            h5.center,\r\n            h6.center {\r\n            text-align: center;\r\n            }\r\n            span.center {\r\n            display: block;\r\n            width: 100%;\r\n            text-align: center;\r\n            }\r\n            img.center {\r\n            margin: 0 auto;\r\n            float: none;\r\n            }\r\n            /* Typography */\r\n            body, table.body, h1, h2, h3, h4, h5, h6, p, td { \r\n            color: #222222;\r\n            font-family: "Helvetica", "Arial", sans-serif; \r\n            font-weight: normal; \r\n            padding:0; \r\n            margin: 0;\r\n            text-align: left; \r\n            line-height: 1.3;\r\n            }\r\n            h1, h2, h3, h4, h5, h6 {\r\n            word-break: normal;\r\n            }\r\n            h1 {font-size: 40px;}\r\n            h2 {font-size: 36px;}\r\n            h3 {font-size: 32px;}\r\n            h4 {font-size: 28px;}\r\n            h5 {font-size: 24px;}\r\n            h6 {font-size: 20px;}\r\n            body, table.body, p, td {font-size: 14px;line-height:19px;}\r\n            p.lead, p.lede, p.leed {\r\n            font-size: 18px;\r\n            line-height:21px;\r\n            }\r\n            p { \r\n            margin-bottom: 10px;\r\n            }\r\n            small {\r\n            font-size: 10px;\r\n            }\r\n            a {\r\n            color: #2ba6cb; \r\n            text-decoration: none;\r\n            }\r\n            a:hover { \r\n            color: #2795b6 !important;\r\n            }\r\n            a:active { \r\n            color: #2795b6 !important;\r\n            }\r\n            a:visited { \r\n            color: #2ba6cb !important;\r\n            }\r\n            h1 a, \r\n            h2 a, \r\n            h3 a, \r\n            h4 a, \r\n            h5 a, \r\n            h6 a {\r\n            color: #2ba6cb;\r\n            }\r\n            h1 a:active, \r\n            h2 a:active,  \r\n            h3 a:active, \r\n            h4 a:active, \r\n            h5 a:active, \r\n            h6 a:active { \r\n            color: #2ba6cb !important; \r\n            } \r\n            h1 a:visited, \r\n            h2 a:visited,  \r\n            h3 a:visited, \r\n            h4 a:visited, \r\n            h5 a:visited, \r\n            h6 a:visited { \r\n            color: #2ba6cb !important; \r\n            } \r\n            /* Panels */\r\n            .panel {\r\n            background: #f2f2f2;\r\n            border: 1px solid #d9d9d9;\r\n            padding: 10px !important;\r\n            }\r\n            table.radius td {\r\n            -webkit-border-radius: 3px;\r\n            -moz-border-radius: 3px;\r\n            border-radius: 3px;\r\n            }\r\n            table.round td {\r\n            -webkit-border-radius: 500px;\r\n            -moz-border-radius: 500px;\r\n            border-radius: 500px;\r\n            }\r\n            /* Outlook First */\r\n            body.outlook p {\r\n            display: inline !important;\r\n            }\r\n            /*  Media Queries */\r\n            @media only screen and (max-width: 600px) {\r\n            table[class="body"] img {\r\n            width: auto !important;\r\n            height: auto !important;\r\n            }\r\n            table[class="body"] center {\r\n            min-width: 0 !important;\r\n            }\r\n            table[class="body"] .container {\r\n            width: 95% !important;\r\n            }\r\n            table[class="body"] .row {\r\n            width: 100% !important;\r\n            display: block !important;\r\n            }\r\n            table[class="body"] .wrapper {\r\n            display: block !important;\r\n            padding-right: 0 !important;\r\n            }\r\n            table[class="body"] .columns,\r\n            table[class