      table[class="body"] .columns td.eleven,\r\n            table[class="body"] .column td.eleven { width: 91.666666% !important; }\r\n            table[class="body"] .columns td.twelve,\r\n            table[class="body"] .column td.twelve { width: 100% !important; }\r\n            table[class="body"] td.offset-by-one,\r\n            table[class="body"] td.offset-by-two,\r\n            table[class="body"] td.offset-by-three,\r\n            table[class="body"] td.offset-by-four,\r\n            table[class="body"] td.offset-by-five,\r\n            table[class="body"] td.offset-by-six,\r\n            table[class="body"] td.offset-by-seven,\r\n            table[class="body"] td.offset-by-eight,\r\n            table[class="body"] td.offset-by-nine,\r\n            table[class="body"] td.offset-by-ten,\r\n            table[class="body"] td.offset-by-eleven {\r\n            padding-left: 0 !important;\r\n            }\r\n            table[class="body"] table.columns td.expander {\r\n            width: 1px !important;\r\n            }\r\n      }\r\n</style>\r\n<style>\r\n            /**************************************************************\r\n            * Custom Styles *\r\n            ***************************************************************/\r\n            /***\r\n            Reset & Typography\r\n            ***/\r\n            body {\r\n            direction: ltr;\r\n            background: #f6f8f1;\r\n            }   \r\n            a:hover {\r\n            text-decoration: underline;\r\n            }\r\n            h1 {font-size: 34px;}\r\n            h2 {font-size: 30px;}\r\n            h3 {font-size: 26px;}\r\n            h4 {font-size: 22px;}\r\n            h5 {font-size: 18px;}\r\n            h6 {font-size: 16px;}\r\n            h4, h3, h2, h1 {\r\n            display: block;\r\n            margin: 5px 0 15px 0;\r\n            }\r\n            h7, h6, h5 {\r\n            display: block;\r\n            margin: 5px 0 5px 0 !important;\r\n            }\r\n            /***\r\n            Buttons\r\n            ***/\r\n            .btn td {\r\n            background: #e5e5e5 !important;\r\n            border: 0;\r\n            font-family: "Segoe UI", Helvetica, Arial, sans-serif;\r\n            font-size: 14px;  \r\n            padding: 7px 14px !important;\r\n            color: #333333 !important;\r\n            text-align: center;\r\n            vertical-align: middle;\r\n            }\r\n            .btn td a {\r\n            display: block;\r\n            color: #fff;\r\n            }\r\n            .btn td a:hover,\r\n            .btn td a:focus,\r\n            .btn td a:active {\r\n            color: #fff !important;\r\n            text-decoration: none;\r\n            }\r\n            .btn td:hover, \r\n            .btn td:focus, \r\n            .btn td:active {  \r\n            background: #d8d8d8 !important;\r\n            }\r\n            /*  Yellow */\r\n            .btn.yellow td {\r\n            background: #ffb848 !important;\r\n            }\r\n            .btn.yellow td:hover, \r\n            .btn.yellow td:focus, \r\n            .btn.yellow td:active { \r\n            background: #eca22e !important;\r\n            }\r\n            .btn.red td{\r\n            background: #d84a38 !important;\r\n            }\r\n            .btn.red td:hover, \r\n            .btn.red td:focus, \r\n            .btn.red td:active {    \r\n            background: #bb2413 !important;\r\n            }\r\n            .btn.green td {\r\n            background: #35aa47 !important;\r\n            }\r\n            .btn.green td:hover, \r\n            .btn.green td:focus, \r\n            .btn.green td:active { \r\n            background: #1d943b !important;\r\n            }\r\n            /*  Blue */\r\n            .btn.blue td {\r\n            background: #4d90fe !important;\r\n            }\r\n            .btn.blue td:hover, \r\n            .btn.blue td:focus, \r\n            .btn.blue td:active {  \r\n            background: #0362fd !important;\r\n            }\r\n            .template-label {\r\n            color: #ffffff;\r\n            font-weight: bold;\r\n            font-size: 11px;\r\n            }\r\n            /***\r\n            Note Panels\r\n            ***/\r\n            .note .panel {\r\n            padding: 10px !important;\r\n            background: #ECF8FF;\r\n            border: 0;\r\n            }\r\n            /***\r\n            Header\r\n            ***/\r\n            .page-header {\r\n            width: 100%;\r\n            background: #1f1f1f;\r\n            }\r\n            /***\r\n            Social Icons\r\n            ***/\r\n            .social-icons {\r\n            float: right;\r\n            }\r\n            .social-icons td {\r\n            padding: 0 2px !important;\r\n            width: auto !important;\r\n            }\r\n            .social-icons td:last-child {\r\n            padding-right: 0 !important;\r\n            }\r\n            .social-icons td img {\r\n            max-width: none !important; \r\n            }\r\n            /***\r\n            Content\r\n            ***/\r\n            table.container.content > tbody > tr > td{\r\n            background: #fff;  \r\n            padding: 15px !important;\r\n            }\r\n            /***\r\n            Footer\r\n            ***/\r\n            .page-footer  {\r\n            width: 100%;\r\n            background: #2f2f2f;\r\n            }\r\n            .page-footer td {\r\n            vertical-align: middle;\r\n            color: #fff;\r\n            }\r\n            /***\r\n            Content devider\r\n            ***/\r\n            .devider {\r\n            border-bottom: 1px solid #eee;\r\n            margin: 15px -15px;\r\n            display: block;\r\n            }\r\n            /***\r\n            Media Item\r\n            ***/\r\n            .media-item img {\r\n            display: block !important;\r\n            float: none;\r\n            margin-bottom: 10px;\r\n            }\r\n            .vertical-middle {\r\n            padding-top: 0;\r\n            padding-bottom: 0;\r\n            vertical-align: middle;\r\n            }\r\n            /***\r\n            Utils\r\n            ***/\r\n            .align-reverse {\r\n            text-align: right;\r\n            }\r\n            .border {\r\n            border: 1px solid red;\r\n            }\r\n            .hidden-mobile {\r\n            display: block;\r\n            }\r\n            .visible-mobile {\r\n            display: none;\r\n            }\r\n            @media only screen and (max-width: 600px) {\r\n            /***\r\n            Reset & Typography\r\n            ***/\r\n            body {\r\n            background: #fff;  \r\n            }\r\n            h1 {font-size: 30px;}\r\n            h2 {font-size: 26px;}\r\n            h3 {font-size: 22px;}\r\n            h4 {font-size: 20px;}\r\n            h5 {font-size: 16px;}\r\n            h6 {font-size: 14px;}\r\n            /***\r\n            Content\r\n            ***/\r\n            table.container.content > tbody > tr > td{\r\n            padding: 0px !important;\r\n            }\r\n            table[class="body"] table.columns .social-icons td {\r\n            width: auto !important;\r\n            }\r\n            /***\r\n            Header\r\n            ***/\r\n            .header {\r\n            padding: 10px !important;\r\n            }\r\n            /***\r\n            Content devider\r\n            ***/\r\n            .devider {\r\n            margin: 15px 0;\r\n            }\r\n            /***\r\n            Media Item\r\n            ***/\r\n            .media-item {\r\n            border-bottom: 1px solid #eee;\r\n            padding: 15px 0 !important;\r\n            }\r\n            /***\r\n            Media Item\r\n            ***/\r\n            .hidden-mobile {\r\n            display: none;\r\n            }\r\n            .visible-mobile {\r\n            display: block;\r\n            }\r\n            }\r\n            .boxshadow5{box-shadow: 0 0 5px rgba(0,0,0,0.5);}\r\n</style>\r\n\r\n\r\n<table class="body">\r\n<tbody><tr>\r\n <td class="center" align="center" valign="top">\r\n   <!-- BEGIN: Header -->\r\n    <table class="page-header" align="center">\r\n    <tbody><tr>\r\n     <td class="center" align="center">\r\n        <!-- BEGIN: Header Container -->\r\n        <table class="container" align="center">\r\n        <tbody><tr>\r\n         <td>\r\n            <table class="row ">\r\n            <tbody><tr>\r\n             <td class="wrapper vertical-middle">\r\n                <!-- BEGIN: Logo -->\r\n                <table class="six columns">\r\n               <tbody><tr>\r\n                 <td class="vertical-middle">\r\n                    <a href="index.html">\r\n                     Shopify Clone\r\n                   </a>\r\n                  </td>\r\n               </tr>\r\n               </tbody></table>\r\n                <!-- END: Logo -->\r\n              </td>\r\n             \r\n            </tr>\r\n           </tbody></table>\r\n          </td>\r\n       </tr>\r\n       </tbody></table>\r\n        <!-- END: Header Container -->\r\n      </td>\r\n   </tr>\r\n   </tbody></table>\r\n    <!-- END: Header -->\r\n    <!-- BEGIN: Content -->\r\n   <table class="container content boxshadow5" align="center">\r\n   <tbody><tr>\r\n     <td>\r\n        <table class="row note">\r\n        <tbody><tr>\r\n         <td class="wrapper last">\r\n           <p> Dear {Customer name},</p>\r\n           <p>\r\n                                        This is to confirm that your account for the shop {Shop name} is now active.\r\n                                    </p>\r\n           <p>The next time you shop at <i>{Shop name}</i> you can save time at checkout by logging into your account. This will refill your address information at the checkout.</p>\r\n          </td>\r\n       </tr>\r\n       </tbody></table>\r\n      </td>\r\n   </tr>\r\n   </tbody></table>\r\n    <!-- END: Content -->\r\n   <!-- BEGIN: Footer -->\r\n    <table class="page-footer" align="center">\r\n    <tbody><tr>\r\n     <td class="center" align="center">\r\n        <table class="container" align="center">\r\n        <tbody><tr>\r\n         <td>\r\n            <!-- BEGIN: Unsubscribet -->\r\n            <table class="row">\r\n           <tbody><tr>\r\n             <td class="wrapper last">\r\n               <span style="font-size:12px;">\r\n                <i>This is a system generated email and reply is not required.</i>\r\n                </span>\r\n             </td>\r\n           </tr>\r\n           </tbody></table>\r\n            <!-- END: Unsubscribe -->\r\n           <!-- BEGIN: Footer Panel -->\r\n            <table class="row">\r\n           <tbody><tr>\r\n             <td class="wrapper">\r\n                <table class="four columns">\r\n                <tbody><tr>\r\n                 <td class="vertical-middle">\r\n                     © Shopify clone 2015.\r\n                  </td>\r\n               </tr>\r\n               </tbody></table>\r\n              </td>\r\n             \r\n            </tr>\r\n           </tbody></table>\r\n            <!-- END: Footer Panel List -->\r\n         </td>\r\n       </tr>\r\n       </tbody></table>\r\n      </td>\r\n   </tr>\r\n   </tbody></table>\r\n    <!-- END: Footer -->\r\n  </td>\r\n</tr>\r\n</tbody></table>\r\n\r\n', 1, '0000-00-00', '2015-07-16'),
(4, 'Trial End', 'Your trial period end', '<!-- BEGIN: Content -->\r\n<table class="container content boxshadow5" align="center"> <tbody><tr><td>\r\n      <table class="row note"><tbody><tr><td class="wrapper last">\r\n            <p> Dear {Customer name},</p>\r\n            <p> Your trial period has been ended. Purchase a plan today and resume business from us. </p>\r\n            <div class="devider"></div>\r\n            <p class="bold">Login details:</p>\r\n            <p>Email address : {email}</p>\r\n            <p> Thanks, </p>\r\n            <p> {Shopify clone} </p></td> </tr> </tbody>\r\n      </table>  </td>  </tr>  </tbody>\r\n</table> <!-- END: Content -->', 1, '0000-00-00', '2015-02-23'),
(5, 'Order Cancelled', 'Order Cancelled', '<table class="container content" align="center"> <tbody><tr> <td>\r\n  <table class="row note">\r\n    <tbody> <tr> <td class="wrapper last">\r\n          <p>Dear {Customer name},</p>\r\n          <p> Greetings from {Store name} <strong></strong> </p>\r\n          <p> As per your request the following order/items in order &nbsp;ID {orderid} has been cancelled successfully. </p><br>\r\n          <p><strong> {note}</strong></p>\r\n          <p><strong>{Address}</strong></p>\r\n          <p> Thanks, </p>\r\n          <p> {Store name} </p>  </td> </tr>\r\n    </tbody>\r\n  </table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-02-24'),
(6, 'Delivered mail to sellar', 'Delivery confirmation of store name with order ID', '<table class="container content" align="center"> <tr> <td>\r\n  <table class="row note">\r\n    <tbody> <tr> <td class="wrapper last">\r\n          <p>Dear {Store name},</p>\r\n         <p> Order ID {orderid} has been delivered to customer on {Date and time}.</p> </p><br>\r\n          <p><strong> {note}</strong></p>\r\n         <p><strong>{Address}</strong></p> </td> </tr>\r\n   </tbody>\r\n  </table> </td> </tr>\r\n</table>\r\n\r\n', 1, '0000-00-00', '2015-07-16'),
(7, 'Delivered mail to Customer', 'Delivery confirmation of store name with order ID', '\r\n<table class="page-header" align="center"> <tbody><tr> <td class="center" align="center">\r\n       <!-- BEGIN: Header Container -->\r\n  <table class="container" align="center"> <tbody><tr> <td>\r\n   <table class="row "> <tbody><tr> <td class="wrapper vertical-middle">\r\n       <!-- BEGIN: Logo -->\r\n        <table class="six columns"> <tbody><tr> <td class="vertical-middle">\r\n         {Store name}  </td> </tr>\r\n        </tbody></table> <!-- END: Logo --> </td> </tr>\r\n   </tbody></table> </td> </tr>\r\n  </tbody></table> <!-- END: Header Container --> </td> </tr>\r\n</tbody></table>\r\n\r\n\r\n\r\n<table class="container content" align="center"> <tbody><tr> <td>\r\n  <table class="row note">\r\n    <tbody> <tr> <td class="wrapper last">\r\n          <p> Dear {Customer name},</p>\r\n         <p> We are pleased to inform you that the following items for your order ID <i>{orderid}</i> have been delivered to you on <i>{Date and time}</i>. <br></p><p> <strong> {note}</strong></p>\r\n         <p><strong>{Address}</strong><br>Thank you for shopping with us.\r\n          </p><p>Thanks,</p>\r\n          <p> {Store name} </p><p> </p>  </td> </tr>\r\n    </tbody>\r\n  </table> </td> </tr>\r\n</tbody></table>\r\n\r\n\r\n<table class="page-footer" align="center"> <tbody><tr> <td class="center" align="center">\r\n      <table class="container" align="center"> <tbody><tr> <td> <!-- BEGIN: Unsubscribet -->\r\n            <table class="row"> <tbody><tr> <td class="wrapper last">\r\n                  <span style="font-size:12px;">\r\n                  <i>This is a system generated email and reply is not required.</i>\r\n                  </span> </td> </tr>\r\n            </tbody></table> <!-- END: Unsubscribe --> <!-- BEGIN: Footer Panel -->\r\n            <table class="row"> <tbody><tr> <td class="wrapper">\r\n                  <table class="four columns"> <tbody><tr> <td class="vertical-middle">\r\n                        © {Store name}. </td> </tr>\r\n                  </tbody></table> </td> </tr>\r\n            </tbody></table> <!-- END: Footer Panel List --> </td> </tr>\r\n      </tbody></table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-03-11'),
(8, 'Shipment to sellar', 'Order ID is ready to shipped', '<table class="container content" align="center"> <tr> <td>\r\n <table class="row note">\r\n    <tbody> <tr> <td class="wrapper last">\r\n          <p>Dear {Store name},</p>\r\n         <p> Order ID {orderid} shipment confirmation have been sent to the customer mail.</p> </p><br>\r\n          <p><strong> {note}</strong></p>\r\n         <p><strong>{Address}</strong></p> </td> </tr>\r\n   </tbody>\r\n  </table> </td> </tr>\r\n</table>', 1, '0000-00-00', '2015-02-23'),
(9, 'Shipment to Customer', 'Order ID is ready to shipped', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n              <p>Dear {Customer name},</p>\r\n              <p> Greetings from {Store name} <strong></strong> </p>\r\n              <p> We are pleased to inform you that following items in your Order&nbsp;ID {orderid} have been packed by the seller and are ready to be shipped, you can receive your product soon. </p><br>\r\n              <p><strong> {note}</strong></p>\r\n              <p><strong>{Address}</strong></p>\r\n              <p> Thanks, </p>\r\n              <p> {Store name} </p>  </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-03-11'),
(10, 'Order details mail', 'Order details [with Order ID] in store name', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n              <p> Dear {Customer name},</p>\r\n             Thank you for shopping with us <br>\r\n             Your order details below for the order ID <i>{orderid}</i> <br>\r\n              </p><p> <strong> {note}</strong></p>\r\n              <p><strong>{Address}</strong> </p>\r\n              <p>Thanks,</p>\r\n              <p> {Store name} </p><p> </p>  </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-02-23'),
(11, 'Order sellar Mail', 'New order [ Order ID ] from customer name', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n              <p> Dear {Store name},</p>\r\n             Your beloved customer have purchased item in your store, please check it and details are mention below for the order ID  <i>{orderid}</i> <br>\r\n              </p><p> <strong> {note}</strong></p>\r\n              <p><strong>{Address}</strong> </p>\r\n              <p>Thanks,</p>\r\n              <p> {Customer name} </p><p> </p>  </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '0000-00-00', '2015-02-23'),
(12, 'Refund mail', 'Refund notification', '<!-- BEGIN: Content -->\r\n<table class="container content boxshadow5" align="center"> <tbody><tr> <td>\r\n      <table class="row note"> <tbody><tr> <td class="wrapper last">\r\n            <p> Dear {Customer name},</p>\r\n            <p> <i>{Store name}</i> have processed  refund for the following  your order in <i>{Orderid}</i>. The amount  of <i>{Amount}</i> towards the order/item will be refunded to your bank card/account. </p>\r\n            <p> Thanks, </p>\r\n            <p> {Shop name} </p>\r\n            <p><strong>Note:</strong> Order summary details display underneath to it.</p> \r\n            </td> </tr> </tbody>\r\n      </table> </td> </tr> </tbody>\r\n</table>\r\n<!-- END: Content -->', 1, '0000-00-00', '2015-02-23'),
(13, 'Store signup', 'Sub: Welcome to shopify clone', '<table class="container content boxshadow5" align="center">\n            <tbody><tr>\n                  <td>\n                        <table class="row note">\n                        <tbody><tr>\n                              <td class="wrapper last">\n                                    <p> Dear {sellar name},</p>\n                                    <p><i>Greeting from {SERVER_NAME} </i></p>\n                                    <p>\n                                          We hearty congratulate you for creating an online store with us. Now you are in a trial period which will expire in 14 days, upgrade for accessing unlimited.\n                                    </p>\n                                     <div class="devider"></div>\n                                    <p class="bold">click here to login</p>\n                                    <p style="color:#FF0000;">{CLICK_HERE_TO_LOGIN}</p>                \n                                    \n                              </td>\n                        </tr>\n                        </tbody></table>\n                  </td>\n            </tr>\n            </tbody></table>', 1, '0000-00-00', '2015-02-23'),
(14, 'admin store new', 'Sub: New store ', 'New Store {STORE_LINK} Registered at {SITE_URL} right now.', 1, '2015-02-27', '2015-02-27'),
(15, 'Emails', 'Emails', 'Emails', 1, '2015-02-28', '2015-02-28'),
(16, 'Account Status', 'Account Status', '<p>Dear Store&nbsp; {storename} ,</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your Store Account is {Status}&nbsp; {Link},<br></p>', 1, '0000-00-00', '0000-00-00'),
(17, 'Upgraded Mail', 'Thank you for upgrading', '<table class="container content" align="center"> <tbody><tr> <td>\r\n    <table class="row note">\r\n        <tbody> <tr> <td class="wrapper last">\r\n            <p>Dear {store name},</p>\r\n            <p>We are pleasure to invite you for the newly upgrade plan {Plan name} until {validity}. We wish you all the best wishes for business growth.</p>\r\n            <p> Thanks, </p>\r\n            <p> Shoppieeshop. </p> </td> </tr>\r\n        </tbody>\r\n    </table> </td> </tr>\r\n</tbody></table>', 1, '2015-06-06', '2015-06-06'),
(18, 'Customer activation storeadmin', 'Account activation', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n                  <p>Dear {firstname},</p>\r\n                  <p> Welcome greetings from {store name},</p>\r\n                  <p>We have created an account for you, just one click <a href="{activation}"> here </a>  to confirm your email address.</p> \r\n                  </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '2015-06-06', '2015-07-16'),
(19, 'Product Signup Register', 'Account activation Mail ', '<table class="container content" align="center"> <tbody><tr> <td>\r\n      <table class="row note">\r\n            <tbody> <tr> <td class="wrapper last">\r\n                  <p>Dear {firstname},</p>\r\n                  <p> {store name} team welcomes you,\r\n                  <p>We are happy to welcome to our store, here you can confirm your email ID with our site by single click. <a href="{activation}"> Click </a> this link to activate your account.</p> </td> </tr>\r\n            </tbody>\r\n      </table> </td> </tr>\r\n</tbody></table>', 1, '2015-07-20', '2015-07-20');
